const agentOutput = $input.first().json;
const threshold = 0.85;

const results = [];

if (agentOutput.performanceFlags && Array.isArray(agentOutput.performanceFlags)) {
  for (const flag of agentOutput.performanceFlags) {
    const hasAlert = flag.performanceScore < threshold;

    results.push({
      json: {
        propertyId: flag.propertyId,
        unitId: flag.unitId,
        status: flag.status,
        performanceScore: flag.performanceScore,
        reason: flag.reason,
        hasAlert: hasAlert,
        rentAdjustments: agentOutput.rentAdjustments || [],
        recommendations: agentOutput.recommendations || [],
        timestamp: new Date().toISOString()
      }
    });
  }
}

return results;

const property = $input.item.json;
const currentRent = property.currentRent || 0;
const recommendedRent = property.recommendedRent || 0;
const adjustmentPercentage = property.adjustmentPercentage || 0;

// Calculate 5-year ROI projection
const annualIncrease = (recommendedRent - currentRent) * 12;
const year1Revenue = recommendedRent * 12;
const year2Revenue = year1Revenue * 1.03; // 3% annual growth
const year3Revenue = year2Revenue * 1.03;
const year4Revenue = year3Revenue * 1.03;
const year5Revenue = year4Revenue * 1.03;

const totalProjectedRevenue = year1Revenue + year2Revenue + year3Revenue + year4Revenue + year5Revenue;
const currentRevenue5Year = currentRent * 12 * 5;
const additionalRevenue = totalProjectedRevenue - currentRevenue5Year;

return {
  json: {
    ...property,
    roiProjection: {
      year1: year1Revenue,
      year2: year2Revenue,
      year3: year3Revenue,
      year4: year4Revenue,
      year5: year5Revenue,
      totalProjected: totalProjectedRevenue,
      additionalRevenue: additionalRevenue,
      roi: (additionalRevenue / currentRevenue5Year) * 100
    }
  }
};

const data = $input.item.json;

const report = {
  propertyId: data.propertyId,
  unitId: data.unitId,
  reportType: data.reportType,
  propertyCategory: data.propertyCategory,
  analysisDate: data.analysisDate,
  currentMetrics: {
    currentRent: data.currentRent,
    occupancyRate: data.occupancyRate || 'N/A',
    noi: data.noi || 'N/A'
  },
  recommendations: {
    recommendedRent: data.recommendedRent,
    adjustmentPercentage: data.adjustmentPercentage,
    priority: data.priority || 'Medium'
  },
  roiProjection: data.roiProjection,
  marketContext: {
    marketAverageRent: data.marketAverageRent || 'N/A',
    marketVacancyRate: data.marketVacancyRate || 'N/A',
    competitivePosition: data.marketPosition || 'N/A'
  },
  summary: `Property ${data.propertyId} - Unit ${data.unitId}: ${data.reportType}. Recommended rent adjustment of ${data.adjustmentPercentage}% with projected 5-year ROI of ${data.roiProjection?.roi?.toFixed(2)}%.`
};

return { json: report };
